import React from 'react';
import './FloatingCharacter.css';

const FloatingCharacter = () => {
  return (
    <div className="character-orbit-container">
      <div className="character-orbit">
        {/* Character going around */}
        <div className="floating-character">
          <div className="character-body">
            <div className="character-head">
              <div className="character-eyes">
                <span className="eye">●</span>
                <span className="eye">●</span>
              </div>
              <div className="character-mouth">◡</div>
            </div>
            <div className="character-wings">
              <span className="wing left-wing">✦</span>
              <span className="wing right-wing">✦</span>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default FloatingCharacter;
